import React from "react"

class Comp extends React.Component{
    constructor(props){
    super(props);
    this.state ={
        mouseState:false
        };  
    this.mouseDown = this.onMouseOver.bind(this);

    }

    mouseDown() {
        console.log("mouse over here");
        this.setState({mouseState:true});

    }
    render()
    {
        console.log(this.state.mouseState);
        return(
            <div>
                <img alt="ok" onMouseOver={this.mouseDown} src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__340.jpg"></img>
            </div>
        )
    }
}

export default Comp
